# coding: utf-8


class Solution:
    def majorityElement(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        boundary = len(nums) / 2
        counter = {}
        for num in nums:
            if num in counter:
                counter[num] += 1
            else:
                counter[num] = 1
        for key in counter.keys():
            if counter[key] > boundary:
                return key


